('1646','2','8177','Wohnung 301 Madrid Belavent',Null,'Erdgeschosswohnung mit Garten und Gemeinschaftspool in Nova Santa Ponsa am Golfplatz','18792','Die Wohnung liegt nur wenige Gehminuten vom Golfplatz Santa Ponsa II & III und dem Jachthafen Port Adriano entfernt.\r\nDie ca. 160 m² Wohnfläche teilen sich auf in Eingangsdiele, Wohn- Esszimmer, Küche, Hauswirtschaftsraum und 3 Schlafzimmer mit 3 Bädern (davon 2 en Suite).\r\nZur Ausstattung gehören Marmorfußboden, Klimaanlage w/k, Einbauküche und Doppelglasfenster. Ein Tiefgaragenplatz und ein Abstellraum stehen ebenfalls zur Verfügung. Erfrischung und Entspannung finden Sie an den zwei zur Wohnanlage gehörenden Pools. ','18793','480000','111','2011-10-17 15:43:00','110','2011-10-17 15:43:40',Null,'1124','121','556',1,'1','0',Null,Null,Null,'18794',Null,'0','0','0',Null,'2016-03-14 11:50:05',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'18795',Null,'18796',Null,'18797',Null,'18798','Portero Toni 669.858.301','18799','0',0,'0');
